import React from 'react'
import { container, Row, Button } from 'reactstrap';
import { NavLink, Link } from 'react-router-dom';

const nav_link = [
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '#',
        display: 'About'
    },
    {
        path: '/tours',
        display: 'Tours'
    }
]

const Header = () => {
    return (
        <div>Header</div>
    )
}

export default Header;
